import React from "react"
import { useSelector } from "react-redux"
import { NavLink } from "react-router-dom"
import style from "./footer.module.css"

function Footer() {
    const adreses = useSelector(state => state.AllAdreses)
    const NumberActiveCity = useSelector(state => state.NumberActiveCity)

    return (
        <div className={style.footer}>
            <div className={style.footerWrapper}>
                <div className={style.footer__contacts}>
                    {logo}
                    <div className={style.footer__street}>{adreses[NumberActiveCity].street}</div>
                    <div className={style.footer__phone}>{adreses[NumberActiveCity].phone}</div>
                </div>

                <div className={style.footer_text}>
                    <div>
                        СТРАНИЦЫ
                    </div>
                    <ul className={(style.li, style.li_none)}>
                        <li>
                            <NavLink to='/' className={style.footer__link}>
                                Главная
                            </NavLink>
                        </li>
                        <NavLink to='/AboutCompany' className={style.footer__link}>
                            О компании
                        </NavLink>

                    </ul>
                </div>

                <div className={style.footer_text}>
                    <div>
                        УСЛУГИ
                    </div>
                    <ul className={style.li}>
                        <li>Проверка слуха</li>
                        <li>Выезд на дом</li>
                        <li>Бесплатная консультация</li>
                        <li>Компенсация от ФСС</li>
                        <li>Беспроцентная рассрочка</li>
                    </ul>
                </div>

                <div className={style.footer_text}>
                    <div>ПРОДУКЦИЯ</div>
                    <ul className={style.li}>
                        <li>Слуховые аппараты</li>
                        <li>Реабилитационная техника</li>
                        <li>Элементы питания</li>
                        <li>Средства по уходу</li>
                    </ul>
                </div>
            </div>
        </div>
    )

}

export default Footer



